import Login from './components/LogIn/Login.jsx';
import { BrowserRouter } from 'react-router-dom';
function App() {
  return (
    <BrowserRouter>
      <div className="App">
        <div className="appClass">
          <Login />
        </div>
      </div>
    </BrowserRouter>
  );
}

export default App;
